(187, 1, '2020-12-11 23:14:40', '2020-12-11 23:14:40', '<!-- wp:html -->\n<div style=\"text-align: center;\">\n<svg width=\"5em\" height=\"5em\" viewBox=\"0 0 16 16\" class=\"bi bi-bookmark-check-fill\" fill=\"currentColor\" xmlns=\"http://www.w3.org/2000/svg\">\n  <path fill-rule=\"evenodd\" d=\"M4 0a2 2 0 0 0-2 2v13.5a.5.5 0 0 0 .74.439L8 13.069l5.26 2.87A.5.5 0 0 0 14 15.5V2a2 2 0 0 0-2-2H4zm6.854 5.854a.5.5 0 0 0-.708-.708L7.5 7.793 6.354 6.646a.5.5 0 1 0-.708.708l1.5 1.5a.5.5 0 0 0 .708 0l3-3z\"></path>\n</svg>\n<h3>Trayectoria</h3>\n<p class=\"texto-servicios\">35 años de experiencia en el mercado inmobiliario.</p>\n</div>\n<!-- /wp:html -->', 'TRAYECTORIA', '', 'inherit', 'closed', 'closed', '', '124-revision-v1', '', '', '2020-12-11 23:14:40', '2020-12-11 23:14:40', '', 124, 'http://localhost/inmobiliariaLaurencenaDev/PaginaLaurencena/2020/12/11/124-revision-v1/', 0, 'revision', '', 0),
