(255, 1, '2020-12-13 16:51:55', '2020-12-13 16:51:55', '<!-- wp:media-text {\"align\":\"full\",\"mediaId\":197,\"mediaLink\":\"http://localhost/inmobiliariaLaurencenaDev/PaginaLaurencena/service/img_historia-2/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignfull is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"http://localhost/inmobiliariaLaurencenaDev/PaginaLaurencena/wp-content/uploads/2020/12/IMG_Historia.gif\" alt=\"\" class=\"wp-image-197 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"textAlign\":\"center\",\"level\":1,\"textColor\":\"vivid-red\"} -->\n<h1 class=\"has-text-align-center has-vivid-red-color has-text-color\"><strong>NUESTRA HISTORIA</strong></h1>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"level\":4,\"textColor\":\"cyan-bluish-gray\"} -->\n<h4 class=\"has-text-align-center has-cyan-bluish-gray-color has-text-color\"><strong>¿Quién o quiénes somos?</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"style\":{\"typography\":{\"fontSize\":14}}} -->\n<p class=\"has-text-align-center\" style=\"font-size:14px\">Fundada por Mario Laurencena en 1930, co-fundador y primer colegiado del Colegio de Martilleros de La Plata, Inmobiliaria Laurencena es una de las más antiguas de la ciudad, avalada por una trayectoria basada tanto en el compromiso como en un trabajo serio y responsable.<br>Consolidada como una empresa familiar, inmobiliaria Laurencena sigue vigente en el mercado gracias a los principios y valores que supo mantener desde sus comienzos, y a un servicio de asesoramiento personalizado, especializado en la mediación en compra, venta y alquiler de viviendas.<br>Desde hace casi cien años brindamos a nuestros clientes la mejor atención integral necesaria para concretar una exitosa operación, basándonos siempre en nuestra experiencia y saber hacer.<br>Si desea conocer más sobre nosotros, cómo funcionamos y cómo podemos ayudarle, le invitamos a visitarnos en nuestra oficina.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\"></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->', 'NUESTRA HISTORIA', '', 'inherit', 'closed', 'closed', '', '99-revision-v1', '', '', '2020-12-13 16:51:55', '2020-12-13 16:51:55', '', 99, 'http://localhost/inmobiliariaLaurencenaDev/2020/12/13/99-revision-v1/', 0, 'revision', '', 0),
